import { motion } from 'framer-motion';
import { useState } from 'react';

export const Example = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [activeTab, setActiveTab] = useState(0);

  const tabs = ["Animations", "Colors", "Interactions"];

  const colors = [
    "bg-gradient-to-r from-purple-500 to-pink-500",
    "bg-gradient-to-r from-blue-500 to-teal-500",
    "bg-gradient-to-r from-orange-500 to-red-500"
  ];

  return (
    <div className="flex flex-col items-center justify-center gap-8">
      {/* Tabs */}
      <motion.div className="flex gap-2">
        {tabs.map((tab, index) => (
          <motion.button
            key={index}
            className={`px-4 py-2 rounded-full ${
              activeTab === index 
                ? "bg-white text-purple-600" 
                : "bg-white/10 text-white"
            }`}
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            onClick={() => setActiveTab(index)}
          >
            {tab}
          </motion.button>
        ))}
      </motion.div>

      {/* Main Container */}
      <motion.div
        className={`${colors[activeTab]} rounded-2xl p-8 cursor-pointer`}
        layout
        onClick={() => setIsOpen(!isOpen)}
        initial={{ borderRadius: 50 }}
        animate={{
          width: isOpen ? 400 : 200,
          height: isOpen ? 400 : 200,
          borderRadius: isOpen ? "30px" : "50px",
          rotate: isOpen ? 0 : 360,
        }}
        transition={{
          layout: { duration: 0.3, type: "spring" },
          rotate: { duration: 0.5 }
        }}
      >
        <motion.div
          layout
          className="text-white font-bold text-xl"
        >
          {isOpen ? "Click to shrink" : "Click to expand"}
        </motion.div>

        {isOpen && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 0.3 }}
            className="text-white mt-4 space-y-4"
          >
            {/* Different content based on active tab */}
            {activeTab === 0 && (
              <>
                <motion.div
                  initial={{ x: -20 }}
                  animate={{ x: 0 }}
                  className="flex gap-2"
                >
                  {[0, 1, 2].map((i) => (
                    <motion.div
                      key={i}
                      className="w-8 h-8 bg-white/20 rounded-lg"
                      animate={{
                        y: [0, -10, 0],
                      }}
                      transition={{
                        duration: 1,
                        repeat: Infinity,
                        delay: i * 0.2,
                      }}
                    />
                  ))}
                </motion.div>
                <p>Hover over elements to see animations!</p>
              </>
            )}

            {activeTab === 1 && (
              <div className="space-y-2">
                <motion.div 
                  className="h-8 bg-white/20 rounded-lg"
                  whileHover={{
                    backgroundColor: "rgba(255,255,255,0.4)",
                    transition: { duration: 0.2 }
                  }}
                />
                <motion.div 
                  className="h-8 bg-white/20 rounded-lg"
                  whileHover={{
                    backgroundColor: "rgba(255,255,255,0.4)",
                    transition: { duration: 0.2 }
                  }}
                />
                <motion.div 
                  className="h-8 bg-white/20 rounded-lg"
                  whileHover={{
                    backgroundColor: "rgba(255,255,255,0.4)",
                    transition: { duration: 0.2 }
                  }}
                />
              </div>
            )}

            {activeTab === 2 && (
              <div className="space-y-4">
                <motion.button
                  className="w-full py-2 bg-white/20 rounded-lg text-white"
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                >
                  Interactive Button
                </motion.button>
                <motion.div
                  className="w-16 h-16 bg-white/20 rounded-lg"
                  drag
                  dragConstraints={{
                    top: 0,
                    left: 0,
                    right: 200,
                    bottom: 200,
                  }}
                  whileDrag={{ scale: 1.2 }}
                >
                  <span className="flex h-full items-center justify-center text-sm">
                    Drag me!
                  </span>
                </motion.div>
              </div>
            )}
          </motion.div>
        )}

        {/* Floating particles */}
        <motion.div
          className="absolute top-2 right-2 w-3 h-3 bg-white/40 rounded-full"
          animate={{
            y: [0, -10, 0],
            opacity: [0.4, 1, 0.4],
          }}
          transition={{
            duration: 2,
            repeat: Infinity,
            ease: "easeInOut"
          }}
        />
        <motion.div
          className="absolute bottom-2 left-2 w-3 h-3 bg-white/40 rounded-full"
          animate={{
            y: [0, 10, 0],
            opacity: [0.4, 1, 0.4],
          }}
          transition={{
            duration: 2,
            repeat: Infinity,
            ease: "easeInOut",
            delay: 0.5
          }}
        />
      </motion.div>

      {/* Info text */}
      <motion.p
        className="text-gray-400 text-sm text-center"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ delay: 0.5 }}
      >
        Try clicking the box and switching between tabs!
      </motion.p>
    </div>
  );
};
